import Negocios from "./Negocios";

const Custos = ({ notas }) => {
  return (
    <div className="App-header">
      {notas.map((nota) => (
        <div className="nota">
          <h3>{nota.corretora}</h3>
          <h3>{nota.data}</h3>
          <h3>{nota.folha}</h3>
          <h3>{nota["nr. nota"]}</h3>
          <h3>{nota.Custos.Total}</h3>
          <Negocios negocios={nota.Negocios} />
        </div>
      ))}
    </div>
  );
};

export default Custos;
